is it really [this](https://stackoverflow.com/questions/1068834/object-comparison-in-javascript) uncomfortable to compare two (methodless) objects?

I came up with the following trick to make the `JSON.stringify()` solution less scary:

```
function sortedObj (obj) {
  var keys = Object.keys(obj).sort()
  var newObj = {}
  keys.forEach(function (key) {
    var el = obj[key]
    if (typeof el === 'object') {
      el = sortedObj(el)
    }
    newObj[key] = el
  }, this)
  return newObj
}
```

